import './UserForm.css';

import Card from '../Card'
import '../Card.css'

export default function UserForm() {

    return (
        <Card>
            <div className="user-card">
                <label>User name</label>
            </div>
            <input></input>
            <div className="user-card">
                <label>Age</label>
            </div>
            <input></input>
        </Card>
    )

};
